def check_int_nonzero(value: str) ->int:
    try:
        uint = int(value)
        if uint == 0:
            raise ValueError
    except ValueError:
        raise ArgumentTypeError(
            f'{value} is invalid for this parameter, should be a non-zero integer value'
            )
