def set_sequence_ids(engine, order_id, trade_id, pairlock_id=None):
    if engine.name == 'postgresql':
        with engine.begin() as connection:
            if order_id:
                connection.execute(text(
                    f'ALTER SEQUENCE orders_id_seq RESTART WITH {order_id}'))
            if trade_id:
                connection.execute(text(
                    f'ALTER SEQUENCE trades_id_seq RESTART WITH {trade_id}'))
            if pairlock_id:
                connection.execute(text(
                    f'ALTER SEQUENCE pairlocks_id_seq RESTART WITH {pairlock_id}'
